import React from 'react'
import styled from "styled-components"

const TileHolder = styled.div`
display: flex;
align-items: center;
flex-wrap: wrap;
justify-content: center;
`;

const TileImage = styled.div`
display: flex;
align-items: center;
justify-content: center;
img{
    width:500px;
    height:500px;
}
`;

const TileName = styled.div`
display: flex;
align-items: center;
flex-wrap: wrap;
justify-content: center;
`;

export default function Teste(){
    return(
        <TileHolder>
            <TileImage>
            <img src={"https://www.clipartmax.com/middle/m2i8d3N4N4Z5b1m2_team-rocket-clipart-pokemon-team-rocket-logo/"} />
            </TileImage>
        </TileHolder>
    )
}
